import React from "react";

function Question({ item, answear }) {
  return (
    <div>
      <h1>{item.question}</h1>
      <div className="answers">
        {item.answers.map((x, i) => (
          <div onClick={() => answear(i)} key={i}>
            {x}
          </div>
        ))}
      </div>
    </div>
  );
}

export default Question;
